~ New_case_study$usertype, FUN = median)\n","aggregate(New_case_study$ride_length ~ New_case_study$usertype, FUN = max)\n","aggregate(New_case_study$ride_length ~ New_case_study$usertype, FUN = min)\n","aggregate(New_case_study$ride_length ~ New_case_study$usertype + New_case_study$day_of_week, FUN = mean)\n","New_case_study$day_of_week <- ordered(New_case_study$day_of_week, levels=c(\"Sunday\", \"Monday\", \"Tuesday\", \"Wednesday\", \"Thursday\", \"Friday\", \"Saturday\"))\n","aggregate(New_case_study$ride_length ~ New_case_study$usertype + New_case_study$day_of_week, FUN = mean)\n","\n","New_case_study %>% \n","  mutate(weekday = wday(start_time, label = TRUE)) %>%  #creates weekday field using wday()\n","  group_by(usertype, weekday) %>%  #groups by usertype and weekday\n","  summarise(number_of_rides = n()\t\t\t\t\t\t\t#calculates the number of rides and average duration \n","            ,average_duration = mean(ride_length)) %>% \t\t# calculates the average duration\n","  arrange(usertype, weekday)\t\t\t\t\t\t\t\t# sorts\n","\n","New_case_study %>% \n","  mutate(weekday = wday(start_time, label = TRUE)) %>% \n","  group_by(usertype, weekday) %>% \n","  summarise(number_of_rides = n()\n","            ,average_duration = mean(ride_length)) %>% \n","  arrange(usertype, weekday)  %>% \n","  ggplot(aes(x = weekday, y = number_of_rides, fill = usertype)) +\n","  geom_col(position = \"dodge\") +\n","  labs(title = \"Rides per Weekday by Usertype\", x = \"Days of the Week\", y = \"Number of Rides\")\n","\n","\n","New_case_study %>% \n","  mutate(weekday = wday(start_time, label = TRUE)) %>% \n","  group_by(usertype, weekday) %>% \n","  summarise(number_of_rides = n()\n","            ,average_duration = mean(ride_length)) %>% \n","  arrange(usertype, weekday)  %>% \n","  ggplot(aes(x = weekday, y = average_duration, fill = usertype)) +\n","  geom_col(position = \"dodge\") +\n","  labs(title = \"Average Ride Duration for Each Usertype\", x = \"Days of the Week\", y = \"